import * as React from 'react';
import {PureComponent} from 'react';



const pinStyle = {
  fill: '#d00',
  stroke: 'none'
};

export default class Pin extends PureComponent {
  render() {
    const {size = 20} = this.props;

    return (
      <svg height={size} viewBox="0 0 24 24" style={pinStyle}>
      </svg>
    );
  }
}
